export function fetchPlayers() {
  return (dispatch) => {
    fetch('http://localhost:3000/players')
    .then(resp => resp.json())
    .then(teams => dispatch({
      type: 'FETCH_PLAYERS',
      payload: player_card
    }))
  }
}
